  \"Tundra swan populations, productivity, and local movements on Selawik National
  Wildlife Refuge, 1983 and 1984\",\n\t\"tracking_summary\": {\n\t\t\"total\": 2,\n\t\t\"recent\":
  1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2016-07-27T23:02:23.965049\",\n\t\"name\": \"tundra-swan-populations-productivity-and-local-movements-on-selawik-national-wildlife-refu\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Studies were initiated in 1983 to document
  the abundance, productivity, and local movements of tundra swans on Selawik National
  Wildlife Refuge. An estimated 2700 - 3200 swans, including 700 - 760 nesting pairs
  summered on the refuge, compared to 9100 swans estimated on the refuge and its coastal
  environs during mid-September staging. Summering locations for the majority of the
  staging population were unknown; however abundant Potamogeton spp. availability
  in Kobuk Lake may have been an attractant. In 1984 breeding swan density was higher
  on the Selawik flats as compared to the Kobuk River delta, opposite to the pattern
  observed in 1983. The reversal may have been due to a shift in favorability of the
  two sites, perhaps related to the late breakup on the more coastal Kobuk delta area
  in 1984. Overall breeding population was slightly higher in 1984 but production
  was slightly lower in 1984, 1081 cygnets as compared to 1277 cygnets in 1983. Local
  movement data from radio instrumented family groups revealed two staging patterns:
  (1) remain in brood-rearing area and migrate west to coastal area near Kobuk Lake/Selawik
  Lake followed by migration to east or (2) remain in brood-rearing area and migrate
  directly east without staging movement. Both Kobuk delta-radioed family groups remained
  within a 3 km radius of their capture area followed by movement to the Kobuk Lake
  coastal area and departure to east. Three of 4 Selawik flats-radioed family groups
  remained within a 3 km radius of capture area then migrated east, whereas one family
  group first moved to the coastal Kobuk Lake area before migrating east.\",\n\t\"license_title\":
